function Favorites({ favorites, removeFromFavorites }) {
  if (favorites.length === 0) {
    return <h2>⭐ No favorites yet</h2>;
  }

  return (
    <div>
      <h1>⭐ Favorites</h1>

      <ul>
        {favorites.map(item => (
          <li key={item.id}>
            {item.name} — ${item.price}
            <button
              onClick={() => removeFromFavorites(item.id)}
              style={{ marginLeft: '8px' }}
            >
              Remove
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Favorites;
